import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoList from './component/TodoList'

function App() {
  return (
    <div className="App">
        <p>
          <TodoList title="Mua bim bim"/>
          <TodoList title="Di Da bong"/>
          <TodoList title="Di choi"/>
        </p>
    </div>
  );
}

export default App;
